import React from 'react';
import {Footer} from "./components/Footer/Footer";
import {Header} from "./components/Header/Header";
import './history.css';

export const HistoryPage = ({ historyRecords }) => {
  return (
    <div className='history'>
      <Header />
      <h1>История запросов</h1>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Даты и время запроса</th>
            <th>Nickname</th>
            <th>User</th>
          </tr>
        </thead>
        <tbody>
          {historyRecords.map((record) => (
            <tr key={record[0]}>
              <td>{record[0]}</td>
              <td>{record[2]}</td>
              <td>{record[1]}</td>
              <td>{record[3]}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <br />
      <button onClick={() => window.location.href = '/'}>Вернуться к поиску</button>
    <Footer />
    </div>
  );
};
